import React from "react"

function CardSide({card, cardSide}) {

    if (cardSide === "front") {
        return (
            <div className="card-text">
                {card.front}
            </div>
        )
    } else if (cardSide === "back") {
        return (
            <div className="card-text">
                {card.back}
            </div>
        )
    }

}

export default CardSide
